import Employee from "../components/Employee/Employee";
const Routes = [
    {
        path: "/employee",
        name: "Employee",
        component: Employee
    },
    {
        path: "/home",
        name: "Home",
        component: Employee
    },
    {
        path: "/about",
        name: "About",
        component: Employee
    },
    {
        path: "/contact",
        name: "Contact",
        component: Employee
    }
]
